import styled from 'styled-components';
import { Image } from 'semantic-ui-react';


export const StyledImage = styled(Image)`
    &&& {  
        border: 1px solid white;
        display: inline-block;
        width: 260px;
        height: 200px;
        margin: 30px auto;
    }
`;
